import React from 'react';
import MyCard from '../../../General/Card/card.js'
import BestDestinations from './bestdestJson.js'
import './bestdest.css'

class ThingsToDo extends React.Component{
  render() {
    return (
      <ul>
        <li>{this.props.item.t1}</li>
        <li>{this.props.item.t2}</li>
        <li>{this.props.item.t3}</li>
        <li>{this.props.item.t4}</li>
        <li>{this.props.item.t5}</li>
        <li>{this.props.item.t6}</li>
      </ul>
    )
  }
}
export default ThingsToDo
